5.	РАБОТНИК обязан:
5.1	полностью, в срок и с надлежащим качеством выполнять работы в соответствии с должностной инструкцией и планом работы подразделения:
5.2	подчиняться Трудовому законодательству и соблюдать правила внутреннего трудового распорядка;
5.3	соблюдать правила и инструкции по охране труда и распоряжения НАНИМАТЕЛЯ или уполномоченного им должностного лица по безопасному ведению работ;
5.4	правильно и по назначению использовать переданное для работы оборудование, средства вычислительной техники, приборы, инструменты, материалы и т.д.;
5.5	соблюдать конфиденциальность сведений, полученных в процессе работы у НАНИМАТЕЛЯ, если они составляют государственную или коммерческую тайну.
6.	РАБОТНИК имеет право требовать НАНИМАТЕЛЯ выполнения условий Трудового договора.

7.	НАНИМАТЕЛЬ обязан:
7.1	предоставлять работнику рабочее место и необходимое для выполнения работ оборудование, приборы, инструменты, материалы и т.д.
7.2	организовать рабочий процесс в рамках действующего законодательства КР;
7.3	обеспечить соблюдение санитарно-гигиенических норм и требований стандартов по охране труда;
7.4	контролировать работу РАБОТНИКА по срокам, качеству и объему работ в порядке, предусмотренном Трудовым договором;
7.5	немедленно сообщать РАБОТНИКУ об обстоятельствах, влияющих на ход выполнения договора;
7.6	не нарушать права работника и не ущемлять его интересы.

15. Действие Трудового договора может быть прекращено на основании статей Трудового Кодекса Кыргызской Республики:
      - по требованию работника;
      - по соглашению сторон;
      - по инициативе НАНИМАТЕЛЯ;
      - по истечении срока действия договора;
      - по обстоятельствам, не зависящим от воли сторон.
